import math

def calculate_area(radius):
    # Bug 1: Should use pi (3.14), not 3.
    # Bug 2: Formula is pi * r^2, not pi * r * 2.
    if radius < 0:
        # Bug 3: Should return 0 or raise error, not 'Error' string
        raise ValueError('Radius cannot be negative')
    return 3.14159 * radius * radius

def test_area():
    # This test should FAIL on the original code
    result = calculate_area(5)
    expected = 78.5 # (3.14 * 25)

    if math.isclose(result, expected):
        print("PASS")
    else:
        print(f"FAIL: Expected {expected}, got {result}")

    # Test case for negative radius
    try:
        calculate_area(-1)
        print("FAIL: Negative radius test did not raise ValueError")
    except ValueError:
        print("PASS: Negative radius test raised ValueError")

    # Test case for zero radius
    result = calculate_area(0)
    expected = 0
    if math.isclose(result, expected):
        print("PASS: Zero radius test passed")
    else:
        print(f"FAIL: Expected {expected}, got {result} for zero radius")

    # Test case for positive radius
    result = calculate_area(2)
    expected = 12.56636
    if math.isclose(result, expected):
        print("PASS: Positive radius test passed")
    else:
        print(f"FAIL: Expected {expected}, got {result} for positive radius")



if __name__ == "__main__":
    test_area()
