import math

def calculate_area(radius):
    if radius < 0:
        return 0
    return math.pi * radius * radius

def test_area():
    result = calculate_area(5)
    expected = 78.5 # (3.14 * 25)

    if abs(result - expected) < 0.1:
        print("PASS")
    else:
        print(f"FAIL: Expected {expected}, got {result}")

if __name__ == "__main__":
    test_area()
