import collections

def update_stock(inventory, items_sold):
    # Bug 1: Syntax Error - missing comma in the dictionary below
    prices = {
        "apple": 0.5,
        "banana": 0.3,
        "orange": 0.7
    }

    # Bug 2: Logic Error - You cannot iterate over a list and remove items 
    # from it at the same time (it skips items).
    sold_counts = collections.Counter(items_sold)

    for item, count in sold_counts.items():
        if item in inventory:
            inventory[item] -= count
            if inventory[item] < 0:
                inventory[item] = 0

    return inventory

def test_inventory():
    # Test case 1
    stock = {"apple": 5, "banana": 2}
    sold = ["apple", "banana"]

    result = update_stock(stock, sold)

    # Check if stock updated correctly
    if result.get("apple") == 4 and result.get("banana") == 1:
        print("PASS")
    else:
        print(f"FAIL: Unexpected stock levels: {result}")

    # Test case 2: item in sold not in inventory
    stock = {"apple": 5}
    sold = ["apple", "banana"]
    result = update_stock(stock, sold)
    if result.get("apple") == 4 and result.get("banana") == None:
        print("PASS")
    else:
        print(f"FAIL: Unexpected stock levels: {result}")

    # Test case 3: multiple instances of same item sold
    stock = {"apple": 5, "banana": 2}
    sold = ["apple", "apple", "banana"]
    result = update_stock(stock, sold)
    if result.get("apple") == 3 and result.get("banana") == 1:
        print("PASS")
    else:
        print(f"FAIL: Unexpected stock levels: {result}")

    # Test case 4: items with zero stock after selling
    stock = {"apple": 1, "banana": 1}
    sold = ["apple", "banana"]
    result = update_stock(stock, sold)
    if result.get("apple") == 0 and result.get("banana") == 0:
        print("PASS")
    else:
        print(f"FAIL: Unexpected stock levels: {result}")

    # Test case 5: Empty inventory
    stock = {}
    sold = ["apple", "banana"]
    result = update_stock(stock, sold)
    if result.get("apple") == None and result.get("banana") == None:
        print("PASS")
    else:
        print(f"FAIL: Unexpected stock levels: {result}")

    # Test case 6: Empty items_sold
    stock = {"apple": 5, "banana": 2}
    sold = []
    result = update_stock(stock, sold)
    if result.get("apple") == 5 and result.get("banana") == 2:
        print("PASS")
    else:
        print(f"FAIL: Unexpected stock levels: {result}")

if __name__ == "__main__":
    test_inventory()
